import Expenses from "./components/Expenses/Expenses"

const App = () => {
  const expenses = [
    { 
      id: "e1",
      title: "Education", 
      amount: 600, 
      date: new Date(2021, 8, 14) 
    },
    { 
      id: "e1",
      title: "Health", 
      amount: 1000, 
      date: new Date(2021, 4, 22) 
    },
    { 
      id: "e1",
      title: "Summer", 
      amount: 200, 
      date: new Date(2021, 7, 7) 
    }
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <p>This is also visible</p>

      <Expenses data={expenses}></Expenses>
    </div>
  );
}

export default App;
